import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import './App.css';
import Navabr from './components/layout/Navbar';

const App = () => {
  return (
    <Router>
      <Fragment>
        <Navabr/>
      </Fragment>
    </Router>
  );
}

export default App;
